  \"CAPContPSPPerInsertDate\",\n\t\"CAPContSysCreatedBy\",\n\t\"CAPContSysUpadtesOn\"\
  ,\n\t\"CAPContCustomerAppsProfile\",\n\t\"CAPContSysMODCount\",\n\t\"CAPContContactDesc\"\
  ,\n\t\"CAPContCONTACT\",\n\t\"CAPContPSPPerDeleteDate\",\n\t\"CAPContSysUpdatedBy\"\
  ,\n\t\"CAPContSysCreatedOn\",\n\t\"CAPContReferenceContact\",\n\t\"CAPContBUStatus\"\
  ,\n\t\"CAPContNotes\",\n\t\"CAPConOptOutCommunication\"\n) as\nSELECT \"DV_U_CUSTOMER_APPS_PROFILE\"\
  \ as \"CAPContCustomerAppsProfileDesc\",\n       \"PSP_PER_UPDATE_DT\" as \"CAPContPSPPerUpdateDate\"\
  ,\n       \"SYS_TAGS\" as \"CAPContSysTags\",\n       \"SYS_ID\" as \"CAPContSysID\"\
  ,\n       \"PSP_PER_INSERT_DT\" as \"CAPContPSPPerInsertDate\",\n       \"SYS_CREATED_BY\"\
  \ as \"CAPContSysCreatedBy\",\n       \"SYS_UPDATED_ON\" as \"CAPContSysUpadtesOn\"\
  ,\n       \"U_CUSTOMER_APPS_PROFILE\" as \"CAPContCustomerAppsProfile\",\n     \
  \  \"SYS_MOD_COUNT\" as \"CAPContSysMODCount\",\n       \"DV_U_CONTACT\" as \"CAPContContactDesc\"\
  ,\n       \"U_CONTACT\" as \"CAPContCONTACT\",\n       \"PSP_PER_DELETE_DT\" as\
  \ \"CAPContPSPPerDeleteDate\",\n       \"SYS_UPDATED_BY\" as \"CAPContSysUpdatedBy\"\
  ,\n       \"SYS_CREATED_ON\" as \"CAPContSysCreatedOn\",\n       \"U_REFERENCE_CONTACT\"\
  \ as \"CAPContReferenceContact\",\n       \"U_BU_STATUS\" as \"CAPContBUStatus\"\
  ,\n       \"U_NOTES\" as \"CAPContNotes\",\n       \"U_OPT_OUT_COMMUNICATION\" as\
  \ \"CAPConOptOutCommunication\"\nFROM \"RDS\".\"SURF\".\"U_CAP_CONTACT\";"
